d too because I’ll want to talk about them. Weirdly attracted to people who cite their sources in everyday conversations.\n\nGeneral Zest for Life: I like my calendar being fairly full of things to do, be they attending talks or trying a new type of exercise. I have main hobbies but am always up for trying something new. I’d really value someone pushing me in new directions.\n\nClear Communication. I’m a direct communicator and can only really be like that. I’m very honest (but not tactless) and take honesty fairly seriously, which friends and family mostly really like.\n\nIndependence. I want a partner, and a partnership, rather than someone to completely merge lives with until we are practically one person. I want to do lots of things with you but wouldn’t expect you to curtail having a life and projects outside of ‘Us’ and I’d want that balance for myself too.\n\u001c*\n\nNon-Negotiables:\nI don’t want kids.\n\nI can’t bear the smell of tobacco. Am not much better with cannabis though if you never smoked where we lived I could maybe manage.\n\nSlightly Negotiables:\nI’m a pretty committed urbanite. I’ve lived in London and Manchester, and might live in other cities in the future but really value living centrally and the lifestyle that allows.\n\nI’m not religious or a believer in the supernatural, and while I don’t mind if you are I am unlikely to ever buy-in and share that beyond joining festivals to be supportive/share experiences.\n\u0012\u001cMy Main Hobbies: \n\nBouldering, Running, Obstacle Course Running. Three years ago I tried bouldering and I’ve fallen into a fitness lifestyle since then. I climb twice a week, run a similar amount, and am working towards the London Marathon in 2026. Allez!\n\nCooking. I cook from scratch almost everything I eat and like expanding my repertoire. Currently trying different seitan recipes as I become ‘Pesc-an’ (Vegan, plus fish). Got a great vegan brownie recipe. Love cooking for friends and family, and would love to cook for a partner.\n\nCat lover. Currently sharing my house with my cat Serral.\n\nRandom research online. From perusing Wikipedia (then double-checking it) to reading government reports, I like knowing more about the world. I’m the kind of person who will fact check myself online. I try to live an evidence-based life and want a data-driven world.\n\nVisiting Museums/Galleries/Places of Interest/Classical Music Performances. No particular theme as to where, I just like seeing friends at somewhere more interesting than a coffee shop if we can. What else is life in London for? Most recent trip: Freemasons Hall. Beautiful but left me with more questions than answers!\n\nPolitical Gambling. I’ve been betting on elections since I was 20, with a good record. I sometimes write about it. But I’m an obsessive, not an addict. I even have the spreadsheets to prove it…\n\nBoard Games. Also another great way to spend time with friends. I’m not hyper-competitive but do tend to do a bit of pre-research and want to give a good account of myself. OK maybe I am competitive, but I’m a pretty good loser.\n\u001c\n\u0012\u001cValues/Personality (This is not a checklist of things you have to be):\n\nI value agency and intentionality, in myself and others. I fear too many people too much of the time make decisions passively, by default or the path of least resistance. I want to live deliberately. I get frustrated by adults not taking accountability for their lives and I want to be held accountable for mine.\n\nIntroverted but outgoing in a comfortable environment. I like a busy social life, just not so open to events with heavy drinking or loud music.\n\nOrganised. I believe in systems. I meal plan, I track my freezer contents in Excel, I check my net worth quarterly, I often instigate and co-ordinate social plans in my friendship groups. I even have a spreadsheet for when I last saw each of my friends so I don’t forget someone for too long (the name turns red after 90 days). They laughed, but then half of them asked me for the template.\n\nHigh Decoupler. I don’t take disagreement personally and am happy to discuss almost anything in a dispassionate way. I try to be sensitive to other people’s discomfort, but I’m rarely unwilling to answer a personal question or consider an idea.\n\nEnvironmentalist. I cycle most journeys if I’m not on the Tube and I very rarely fly for leisure at the moment (though I might in future, especially if I found some effective offsets). I’m also a YIMBY and a New Urbanist. Don’t own a car, but can drive and would get one if it made sense for my life.\n\nEffective Altruist. By which I mean I donate 10% of my salary to effective charities and generally buy-in to the concept.\n\u001c\n\u0011"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_mt":36.0,"ds_lhs":1,"ds_mb":36.0,"ds_ulhfl":false}},{"ty":"ae","et":"list","id":"kix.6yjlmbyt2sld","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"-","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"-","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"
